import React from "react";
import { Link } from "react-router-dom";
import { FormattedMessage } from "react-intl";

function Header() {
    return (
        <header>
            <div className="logo-container">
                <img
                    src="https://www.skrill.com/fileadmin/Personal/promotions/skrill-ac-milan/ac-milan.PNG"
                    alt="AC Milan Logo"
                    className="logo-img"
                />
                <span className="logo-text">AC Milan</span>
                <ul className="nav">
                    <li><Link to="/about"><FormattedMessage id="about" /></Link></li>
                    <li><Link to="/team"><FormattedMessage id="main_team" /></Link></li>
                    <li><Link to="/youth"><FormattedMessage id="youth_team" /></Link></li>
                </ul>
            </div>
            <div className="presentation"></div>
        </header>
    );
}

export default Header;
